[[File:Frankie chathead.png|left]]
'''Frankie''' is the owner of [[Frankie's Fishing Emporium]] in [[Port Piscarilius]]. He is wearing parts of the [[angler's outfit]] and is toting a [[fishing rod]]. He buys and sells raw [[fish]], including [[raw shark]]s, but has no stock.

Players can help him collect [[fresh fish]] and deposit them into the cooling chest inside his store for [[Port Piscarilius|Piscarilius]] [[favour]].

Due to his fishing rod, Frankie's detection area is about twice as large as other NPCs.

